def count_holy_triplets(points):

    def slope(x1, y1, x2, y2):
        if x2 - x1 == 0:
            return 'inf'
        return float(y2 - y1) / (x2 - x1)
    n = len(points)
    c = 1
    for j in range(n):
        m = {}
        for k in range(n):
            if k == j:
                continue
            s = slope(points[j][0], points[j][1], points[k][0], points[k][1])
            if s in m:
                m[s] += 1
            else:
                m[s] = 1
        for k in m:
            if k == 'inf':
                if 0 in m:
                    c += m[0] * m[k]
                continue
            if k == 0:
                if 'inf' in m:
                    c += m['inf'] * m[k]
                continue
            if -1 / k in m:
                c += m[-1 / k] * m[k]
    return c // 2

